import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card'
import productimg from 'C:/Users/muham/Desktop/final-year-project/client/src/images/Red_NavyBlueCheckeredShirtBrumanoPakistan_1.jpg'
import {FcHome,FcLike,FcBusinessman} from 'react-icons/fc'
export default function ProductCard() {
  return (
    <Card style={{ width: '18rem' }} className="m-2">
      <Card.Img variant="top" src={productimg} />
      <Card.Body>
        <Card.Title>Card Title</Card.Title>

        <Button variant="border border-3"><FcLike/></Button>
      </Card.Body>
    </Card>

  )
}
